import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import {jwtDecode} from "jwt-decode"; // Importando corretamente jwt-decode
import axios from "axios";
import Cookies from "js-cookie";

const PacientePage = () => {
  const [user, setUser] = useState(null);
  const [pacienteData, setPacienteData] = useState(null);
  const [error, setError] = useState("");
  const navigate = useNavigate();

  // Função para obter os dados do paciente
  const fetchPacienteData = async () => {
    try {
      const token = Cookies.get("auth_token");
      if (!token) {
        setError("Usuário não autenticado.");
        navigate("/login"); // Redireciona para a página de login se não houver token
        return;
      }

      const decodedToken = jwtDecode(token); // Decodificando o token JWT
      setUser(decodedToken); // Armazenando os dados do usuário decodificado

      // Fetch dos dados do paciente com base no ID (ou outro identificador)
      const response = await axios.get(`http://127.0.0.1:8000/api/paciente/${decodedToken.id}`, {
        headers: {
          Authorization: `Bearer ${token}`,
        },
      });
      
      setPacienteData(response.data);
    } catch (err) {
      console.error("Erro ao buscar dados do paciente:", err);
      setError("Erro ao carregar dados.");
    }
  };

  // Usando useEffect para chamar a função assim que a página for carregada
  useEffect(() => {
    fetchPacienteData();
  }, []);

  // Se não houver dados do paciente ou usuário, exibe um estado de carregamento ou erro
  if (!pacienteData && !error) {
    return <div>Carregando...</div>;
  }

  // Exibindo a página com as informações do paciente
  return (
    <div style={styles.container}>
      <header style={styles.header}>
        <h1 style={styles.title}>Bem-vindo, {user ? user.name : "Paciente"}</h1>
        {error && <p style={{ color: "red" }}>{error}</p>}
      </header>

      <section style={styles.content}>
        <h2>Informações do Paciente</h2>
        {pacienteData ? (
          <div style={styles.infoBox}>
            <p><strong>Nome:</strong> {pacienteData.nome}</p>
            <p><strong>Email:</strong> {pacienteData.email}</p>
            <p><strong>Idade:</strong> {pacienteData.idade}</p>
            <p><strong>Telefone:</strong> {pacienteData.telefone}</p>
          </div>
        ) : (
          <div>Erro ao carregar os dados.</div>
        )}
      </section>

      <footer style={styles.footer}>
        <button style={styles.logoutButton} onClick={() => {
          Cookies.remove("auth_token");
          navigate("/login"); // Redireciona para a página de login após deslogar
        }}>
          Sair
        </button>
      </footer>
    </div>
  );
};

const styles = {
  container: {
    fontFamily: "Arial, sans-serif",
    margin: 0,
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    paddingTop: "20px",
    minHeight: "100vh",
    backgroundColor: "#fff",
  },
  header: {
    textAlign: "center",
    marginBottom: "20px",
  },
  title: {
    fontSize: "30px",
    fontWeight: "bold",
    color: "#333",
  },
  content: {
    width: "80%",
    maxWidth: "600px",
    marginTop: "30px",
    padding: "20px",
    backgroundColor: "#f9f9f9",
    borderRadius: "8px",
    boxShadow: "0 4px 10px rgba(0, 0, 0, 0.1)",
  },
  infoBox: {
    padding: "15px",
    backgroundColor: "#fff",
    borderRadius: "8px",
    boxShadow: "0 2px 5px rgba(0, 0, 0, 0.1)",
  },
  footer: {
    marginTop: "30px",
    textAlign: "center",
  },
  logoutButton: {
    padding: "10px 20px",
    backgroundColor: "#d81b1b",
    color: "#fff",
    border: "none",
    borderRadius: "5px",
    cursor: "pointer",
    fontSize: "16px",
  },
};

export default PacientePage;
